import React from 'react';
import styled from 'styled-components';

function ResumeListWrapper() {
	return (
		<ComponentWrapper>
			<div
				className="ResumeItem_ResumeItem__MnI_V"
				data-attribute-id="resume__click"
				role="button"
			>
				<div className="ResumeList_ResumeList_addItem__Aifx4">
					<div className="ResumeList_ResumeList_addItem_icon__yfHFj">
						<i className="icon-new_resume" />
					</div>
					<p>새 이력서 작성</p>
				</div>
			</div>
			<div
				className="ResumeItem_ResumeItem__MnI_V"
				data-attribute-id="resume__click"
				role="button"
			>
				<div className="ResumeList_ResumeList_upload___7VWD">
					<input
						multiple=""
						type="file"
						autoComplete="off"
						style={{ display: 'none' }}
					/>
					<div className="ResumeList_ResumeList_upload_icon__3SGaN">
						<i className="icon-upload_resume" />
					</div>
					<p>파일 업로드</p>
				</div>
			</div>
			<div
				className="ResumeItem_ResumeItem__MnI_V"
				data-attribute-id="resume__click"
				data-resume-key="BgAKCw8GAE4HBA0DBwsKSkU="
				role="button"
			>
				<div className="ResumeItem_ResumeItem_badge__sCl6m">
					<div className="MatchupBadge_Badge__Wj30S">
						<p>매치업 이력서</p>
					</div>
				</div>
				<div className="ResumeItem_ResumeItem_title__qQK05">
					<h3 iswriting="1">이해찬 1</h3>
					<p>2022.07.19</p>
				</div>
				<div className="ResumeItem_ResumeItem_info__c1IDT">
					<div
						className="ResumeItem_ResumeItem_lang__9yraF"
						iswriting="1"
					>
						한
					</div>
					<span className="writing" iswriting="1">
						작성 중
					</span>
					<div
						id="resume-BgAKCw8GAE4HBA0DBwsKSkU=-dropdown-container"
						className="ResumeItem_ResumeItem_menu__2rvp8"
					>
						<button type="button">
							<i className="icon-more_vert" />
						</button>
					</div>
				</div>
			</div>
			<div />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	display: flex;
	flex-direction: row;
	justify-content: flex-start;
	width: calc(100% + 20px);
	flex-wrap: wrap;

	.ResumeItem_ResumeItem__MnI_V {
		height: 190px;
		width: calc(25% - 20px);
		margin-bottom: 20px;
		margin-right: 20px;
		position: relative;
		border: 1px solid #dbdbdb;
		background-color: #fff;
	}
	.ResumeList_ResumeList_addItem__Aifx4 {
		height: 100%;
		display: -ms-flexbox;
		display: flex;
		-ms-flex-direction: column;
		flex-direction: column;
		-ms-flex-align: center;
		align-items: center;
		-ms-flex-pack: center;
		justify-content: center;
		p {
			font-size: 16px;
			font-weight: 600;
			letter-spacing: normal;
			text-align: center;
			color: #333;
			margin: 20px 0 0;
		}
	}
	.ResumeList_ResumeList_addItem_icon__yfHFj {
		background-color: #36f;
		color: #fff;
		cursor: pointer;
		width: 74px;
		height: 74px;
		margin: 0 auto;
		border-radius: 50%;
		display: flex;
		justify-content: center;
		align-items: center;
		font-size: 26px;
	}
	.ResumeList_ResumeList_upload_icon__3SGaN {
		cursor: pointer;
		width: 74px;
		height: 74px;
		margin: 0 auto;
		border-radius: 50%;
		display: flex;
		justify-content: center;
		align-items: center;
		font-size: 26px;
		background-color: #e1e2e3;}
		.ResumeList_ResumeList_upload___7VWD {
			height: 100%;
			display: -ms-flexbox;
			display: flex;
			-ms-flex-direction: column;
			flex-direction: column;
			-ms-flex-align: center;
			align-items: center;
			-ms-flex-pack: center;
			justify-content: center;
		}
	}
`;

export default ResumeListWrapper;
